import{_ as e,c as s,o as t,ag as r}from"./chunks/framework.UkHUymdI.js";const g=JSON.parse('{"title":"常见问题解答","description":"","frontmatter":{"title":"常见问题解答","order":2},"headers":[],"relativePath":"关于前端助手/常见问题解答.md","filePath":"关于前端助手/常见问题解答.md","lastUpdated":1739788303000}'),i={name:"关于前端助手/常见问题解答.md"};function n(l,a,o,d,h,c){return t(),s("div",null,a[0]||(a[0]=[r('<h1 id="常见问题解答" tabindex="-1">常见问题解答 <a class="header-anchor" href="#常见问题解答" aria-label="Permalink to &quot;常见问题解答&quot;">​</a></h1><h2 id="安装与更新问题" tabindex="-1">安装与更新问题 <a class="header-anchor" href="#安装与更新问题" aria-label="Permalink to &quot;安装与更新问题&quot;">​</a></h2><h3 id="安装后无响应" tabindex="-1">安装后无响应 <a class="header-anchor" href="#安装后无响应" aria-label="Permalink to &quot;安装后无响应&quot;">​</a></h3><p><strong>问题</strong>: 安装扩展之后没有反应？<br><strong>解决</strong>: 检查网络连接。如果使用需要代理的链接，请确保酒馆通过 VPN 连接网络。</p><h3 id="扩展不显示或无法勾选" tabindex="-1">扩展不显示或无法勾选 <a class="header-anchor" href="#扩展不显示或无法勾选" aria-label="Permalink to &quot;扩展不显示或无法勾选&quot;">​</a></h3><p><strong>问题</strong>: 安装提示成功但扩展界面未显示，或管理面板中无法勾选扩展/更新后扩展消失<br><strong>解决</strong>: 升级酒馆版本。扩展仅支持1.12.6及以上版本。</p><h3 id="安装时提示文件夹已存在" tabindex="-1">安装时提示文件夹已存在 <a class="header-anchor" href="#安装时提示文件夹已存在" aria-label="Permalink to &quot;安装时提示文件夹已存在&quot;">​</a></h3><p><strong>问题</strong>: 提示 <code>Extension installation failed, Directory already exists...</code>的黄色错误弹窗<br><strong>解决</strong>:</p><ol><li>进入酒馆安装目录 <code>SillyTavern/data/default-user/extensions</code></li><li>删除 <code>JS-Slash-Runner</code> 文件夹</li><li>检查网络连接（建议使用不需要国外网络环境的gitlab安装链接），重新安装扩展</li></ol><h3 id="安卓文件访问" tabindex="-1">安卓文件访问 <a class="header-anchor" href="#安卓文件访问" aria-label="Permalink to &quot;安卓文件访问&quot;">​</a></h3><p><strong>问题</strong>: 如何在安卓手机上访问酒馆文件夹？<br><strong>解决</strong>: (仅适用于部分安卓系统，未经全面测试)</p><ul><li><p><strong>方法一</strong>: 通过文件管理器</p><ol><li>启动 Termux</li><li>使用系统文件管理器进入受限制目录 Android/data</li><li>在新的文件管理界面通过侧边栏访问 Termux</li></ol></li><li><p><strong>方法二</strong>: 使用 MT 管理器</p><ol><li>启动 Termux</li><li>在 MT 管理器添加本地存储</li><li>通过 MT 管理器侧边栏访问 Termux</li></ol></li><li><p><strong>方法三</strong>: 使用 zerotermux<br> 详见： <a href="https://discord.com/channels/1134557553011998840/1327980841497788457/1328211004194291714" target="_blank" rel="noreferrer">https://discord.com/channels/1134557553011998840/1327980841497788457/1328211004194291714</a></p></li><li><p>找不到文件夹但还是提示文件夹存在？<strong>终极方案</strong>:</p><ol><li>打开termux，如果装了一键脚本输入0退出</li><li>输入下面的内容，回车</li></ol><div class="language-bash vp-adaptive-theme line-numbers-mode"><button title="Copy Code" class="copy"></button><span class="lang">bash</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span style="--shiki-light:#005CC5;--shiki-dark:#79B8FF;">cd</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> /</span></span></code></pre><div class="line-numbers-wrapper" aria-hidden="true"><span class="line-number">1</span><br></div></div><ol start="3"><li>输入下面的内容，回车，然后等待搜索完成</li></ol><div class="language-bash vp-adaptive-theme line-numbers-mode"><button title="Copy Code" class="copy"></button><span class="lang">bash</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">find</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> ~</span><span style="--shiki-light:#005CC5;--shiki-dark:#79B8FF;"> -type</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> d</span><span style="--shiki-light:#005CC5;--shiki-dark:#79B8FF;"> -name</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> &quot;JS-Slash-Runner&quot;</span></span></code></pre><div class="line-numbers-wrapper" aria-hidden="true"><span class="line-number">1</span><br></div></div><p>如果文件夹存在，上面会得到一个路径，复制下来，执行第四步</p><p>4.使用<code>rm -rf </code>为开头（rf后面有一个空格），后接第三步搜索到的路径，输入命令后回车，以下是示例，路径需要你自行替换</p><div class="language-bash vp-adaptive-theme line-numbers-mode"><button title="Copy Code" class="copy"></button><span class="lang">bash</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">rm</span><span style="--shiki-light:#005CC5;--shiki-dark:#79B8FF;"> -rf</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> /root/SillyTavern1.12.6/SillyTavern/data/default-user/extensions/JS-Slash-Runner</span></span></code></pre><div class="line-numbers-wrapper" aria-hidden="true"><span class="line-number">1</span><br></div></div><div class="warning custom-block"><p class="custom-block-title">注意</p><p>此方法删除后不会有任何提示，请谨慎使用。下面是直接一键删除的命令，但可控性较差： <code>find ~ -type d -name &quot;JS-Slash-Runner&quot; | rm -rf</code></p></div></li></ul><h3 id="git-相关错误" tabindex="-1">Git 相关错误 <a class="header-anchor" href="#git-相关错误" aria-label="Permalink to &quot;Git 相关错误&quot;">​</a></h3><p><strong>问题</strong>: 提示 <code>Extension installation failed, Server Error:Error: spawn git ENOENT...</code>的黄色错误弹窗<br><strong>解决</strong>: 安装/重新安装 git 或添加 git 到环境变量</p><h3 id="手动安装方法" tabindex="-1">手动安装方法 <a class="header-anchor" href="#手动安装方法" aria-label="Permalink to &quot;手动安装方法&quot;">​</a></h3><p><strong>问题</strong>: 常规安装方法都失败？<br><strong>解决</strong>:</p><ol><li>确保为国外网络环境</li><li>访问 <a href="https://github.com/N0VI028/JS-Slash-Runner" target="_blank" rel="noreferrer">N0VI028/JS-Slash-Runner</a></li><li>点击页面右上角绿色按钮 <code>Code</code> ，选择 <code>Download ZIP</code> 下载压缩包</li><li>解压并重命名为 <code>JS-Slash-Runner</code></li><li>移动到 <code>SillyTavern/data/default-user/extensions</code> 目录 (酒馆多用户使用者请将 default-user 替换为实际用户名)</li></ol><div class="warning custom-block"><p class="custom-block-title">注意</p><p>使用此方法安装的扩展无法自动检查更新</p></div><h3 id="更新加载问题" tabindex="-1">更新加载问题 <a class="header-anchor" href="#更新加载问题" aria-label="Permalink to &quot;更新加载问题&quot;">​</a></h3><p><strong>问题</strong>: 扩展管理面板一直显示 <code>Loading third-party extensions...</code><br><strong>解决</strong>: 连接或更换 VPN 后重试</p><h3 id="提示未连接到api" tabindex="-1">提示未连接到API <a class="header-anchor" href="#提示未连接到api" aria-label="Permalink to &quot;提示未连接到API&quot;">​</a></h3><p><strong>问题</strong>: 扩展或扩展管理界面显示 <code>Not connected to the API!</code> 或 <code>Could not connect to API</code> 的红色错误提示文字<br><strong>解决</strong>: 此提示与前端助手无关，本扩展无需连接API</p><h2 id="作者常见问题" tabindex="-1">作者常见问题 <a class="header-anchor" href="#作者常见问题" aria-label="Permalink to &quot;作者常见问题&quot;">​</a></h2><h3 id="代码渲染问题" tabindex="-1">代码渲染问题 <a class="header-anchor" href="#代码渲染问题" aria-label="Permalink to &quot;代码渲染问题&quot;">​</a></h3><p><strong>问题</strong>: 代码未能正确渲染？<br><strong>解决</strong>: 确保同时满足：</p><ol><li>代码使用三个反引号包裹</li><li>代码中包含 <code>&lt;body&gt;&lt;/body&gt;</code> 闭合标签</li></ol><h3 id="界面闪现问题" tabindex="-1">界面闪现问题 <a class="header-anchor" href="#界面闪现问题" aria-label="Permalink to &quot;界面闪现问题&quot;">​</a></h3><p><strong>问题</strong>: 界面短暂显示后消失？<br><strong>解决</strong>: 检查并关闭可能存在冲突的扩展或油猴插件</p><h3 id="qr-触发失效" tabindex="-1">QR 触发失效 <a class="header-anchor" href="#qr-触发失效" aria-label="Permalink to &quot;QR 触发失效&quot;">​</a></h3><p><strong>问题</strong>: QR 触发不起作用？<br><strong>解决</strong>: 检查并删除代码中的 triggerSlash 函数定义，避免覆盖扩展默认定义</p><h2 id="界面显示问题" tabindex="-1">界面显示问题 <a class="header-anchor" href="#界面显示问题" aria-label="Permalink to &quot;界面显示问题&quot;">​</a></h2><p>如扩展安装成功但界面显示失败，请参考以下帖子进行自查：<br><a href="https://discord.com/channels/1134557553011998840/1324937235623051385" target="_blank" rel="noreferrer">https://discord.com/channels/1134557553011998840/1324937235623051385</a></p>',32)]))}const u=e(i,[["render",n]]);export{g as __pageData,u as default};
